import { useEffect, useState } from "react"
import { topicApi } from "../../services/ListQuestion";

function Topic() {
    const [data,setData] = useState([]);
    useEffect(() => {
        const fecthApi = async () => {
            const result = await topicApi();
            setData(result);
        }
        fecthApi();
    },[]);
    return(
        <>
        <h5>Danh sách chủ đề ôn luyện </h5>
        <table>
            <thead>
                <tr>
                <th>ID</th>
                <th>Tên chủ đề </th>
                </tr>
            </thead>
            <tbody>
                {data.map(item => (
                    <>
                    <td key={item.id}>{item.id}</td>
                    <td>{item.name}</td>
                    <td><button>Làm Bài</button></td>
                    </>
                ))}
            </tbody>
        </table>
        </>
    )
}
export default Topic
